use strict;
#use warnings;

my %hash=();
open(RF,"risk.txt") or die $!;
while(my $line=<RF>){
	chomp($line);
	if($.==1){
		my @arr=split(/\t/,$line);
		foreach my $i(3..($#arr-2)){
			$hash{$arr[$i]}=1;
		}
	}
}
close(RF);

my %repHash=();
open(RF, "corResult.txt") or die $!;
open(NET, ">network.txt") or die $!;
print NET "Gene\tLncRNA\tType\n";
open(NODE, ">node.txt") or die $!;
print NODE "Name\tType\n";
while(my $line=<RF>){

	chomp($line);
	my @arr=split(/\t/,$line);
	if(exists $hash{$arr[1]}){
		unless(exists $repHash{"$arr[0]\t$arr[1]"}){
			print NET "$arr[0]\t$arr[1]\tcoexpression\n";
			$repHash{"$arr[0]\t$arr[1]"}=1;
		}
		unless(exists $repHash{$arr[0]}){
			print NODE "$arr[0]\tGene\n";
			$repHash{$arr[0]}=1;
		}
		unless(exists $repHash{$arr[1]}){
			print NODE "$arr[1]\tLncRNA\n";
			$repHash{$arr[1]}=1;
		}
	}
}
close(NET);
close(NODE);
close(RF);


